function serviceproviderListReducer(state={serviceproviders:[] }, action){
    switch (action.type) {
        case PRODUCT_LIST_REQUEST:
        return {loading: true};

        case SERVICEPROVIDER_LIST_SUCCESS:
            return{loading: false, serviceproviders: action.payload};
         
            case SERVICEPROVIDER_LIST_FAIL:
                return{loading: false, error: action.payload};

                default:
                    return state;
    }
}

export { serviceproviderListReducer}
